import React, { useEffect, useState } from 'react';
import './LevelPage.css';

const LevelPage = () => {
  const [headerVisible, setHeaderVisible] = useState(false);

  useEffect(() => {
    setTimeout(() => {
      setHeaderVisible(true);
    }, 100); // Немного подождем перед началом анимации
  }, []);

  return (
    <div className="level-home">
      <div className={`level-header ${headerVisible ? 'level-header-visible' : ''}`}>
        <div className="level-stars"></div>
        <h1>Level Page</h1>
      </div>
      <div className="level-content">
        <p>This is the content of the level page.</p>
      </div>
    </div>
  );
};

export default LevelPage;
